import React from "react";


function Submit(){
    return(
        <div class="jumbotron jumbotron-fluid">
        <div class="container">
          <h1 class="display-4">Thank you for contacting us</h1>
          <p class="lead">We will get back to you as soon as possible.</p>
        </div>
      </div>
    )
}

export default Submit;
